import React, { Component } from 'react'

class UsersItem extends Component {
      constructor(){
            super();
            this.state = {
                  id : 'id',
                  login : 'mojombo' ,
                  avatar_url : 'https://media.kaufland.com/images/PPIM/AP_Content_2708/bul/02/71/Asset_3280271.jpg',
                  html_url: 'https://github.com/mojombo'
            }

      }


      render() {
            return (
                  <div className ='card text-center'>
                        <img  src = {this.state.avatar_url} 
                              alt = ''
                              className = 'round-img' 
                              style = {{
                                    width:  '60px'
                              }}/>
                  </div>
            )
      }
}

export default UsersItem
